<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <title>Citadel Luxury Garages</title>
  <style>
    body {
      font-family: Arial, sans-serif;
      margin: 0;
      padding: 0;
      background: #f8f9fa;
      display: flex;
      flex-direction: column;
      height: 100vh;
    }
    header {
      background: #1e2a38;
      color: white;
      text-align: center;
      padding: 15px;
      font-size: 24px;
      font-weight: bold;
    }
    main {
      display: flex;
      flex: 1;
      overflow: hidden;
    }
    #map-container {
      position: relative;
      flex: 1;
      border-right: 1px solid #ccc;
      background: #fff;
      overflow: auto;
    }
    svg {
      width: 100%;
      height: auto;
    }
    #sidebar {
      width: 360px;
      background: #1e2a38;
      color: #f1f1f1;
      overflow-y: auto;
      padding: 15px;
      box-shadow: -2px 0 5px rgba(0,0,0,0.3);
      display: flex;
      flex-direction: column;
    }
    .unit-card {
      border: 1px solid #555;
      border-left: 5px solid transparent;
      margin-bottom: 10px;
      padding: 8px;
      background: #2a3646;
      border-radius: 4px;
      font-size: 14px;
      cursor: pointer;
    }
    .unit-card.available { border-left-color: green; }
    .unit-card.reserved { border-left-color: orange; }
    .unit-card.sold { border-left-color: red; }
    .highlight {
      stroke: #000;
      stroke-width: 3px;
    }
    .legend {
      display: flex;
      gap: 15px;
      margin-bottom: 15px;
    }
    .legend-item {
      display: flex;
      align-items: center;
      gap: 5px;
      font-size: 14px;
    }
    .legend-square {
      width: 15px;
      height: 15px;
      display: inline-block;
    }
    .green { background: green; }
    .orange { background: orange; }
    .red { background: red; }
    .selected { fill-opacity: 0.8 !important; stroke: #000 !important; stroke-width: 3px; }
    .tooltip {

    .tooltip img {
      max-width: 200px;
      display: block;
      margin-top: 6px;
      border-radius: 6px;
    }

      position: absolute;
      background: #2a3646;
      color: #f1f1f1;
      border: 1px solid #555;
      padding: 8px;
      font-size: 13px;
      pointer-events: none;
      border-radius: 6px;
      display: none;
      z-index: 10;
      box-shadow: 0 2px 6px rgba(0,0,0,0.4);
    }
    #filter {
      background: #2a3646;
      color: #f1f1f1;
      border: 1px solid #555;
      padding: 6px 10px;
      border-radius: 4px;
      font-size: 14px;
      width: 100%;
      margin-top: 5px;
    }
    #filter:focus {
      outline: none;
      border-color: #888;
    }
    #sidebar label {
      font-size: 14px;
      margin-bottom: 4px;
      display: block;
    }
  </style>

      let units = Object.keys(data.unitData).map(id => ({ id, ...data.unitData[id] }));

      if (filter === "available") {
        units = units.filter(u => u.status === "Available");
      } else if (filter === "mezzanine") {
        units = units.filter(u => (u.amenities || "").toLowerCase().includes("mezzanine"));
      } else if (filter === "price") {
        units.sort((a,b) => parseInt(a.price.replace(/[^0-9]/g,"")) - parseInt(b.price.replace(/[^0-9]/g,"")));
      }

      units.forEach(d => {
        const card = document.createElement("div");
        card.className="unit-card "+d.status.toLowerCase();
        card.id="card-"+d.id;
        card.innerHTML = `<strong>Unit ${d.id}</strong><br>
          Status: ${d.status}<br>
          Size: ${d.length}x${d.width} (${d.sqft} sqft)<br>
          Price: ${d.price}<br>
          ${d.amenities?`Amenities: ${d.amenities}`:""}`;
        card.addEventListener("click",()=>document.getElementById("unit-"+d.id).dispatchEvent(new Event("click")));
        unitList.appendChild(card);
      });
    }

    filterSelect.addEventListener("change", () => renderSidebar(filterSelect.value));

    function showTooltip(evt, d) {
      tooltip.style.display = "block";
      tooltip.style.left = (evt.pageX + 10) + "px";
      tooltip.style.top = (evt.pageY + 10) + "px";
      tooltip.innerHTML = `<strong>Unit ${d.id}</strong><br>
        Status: ${d.status}<br>
        Dimensions: ${d.length} × ${d.width} (${d.sqft} sqft)<br>
        Price: ${d.price}<br>
        ${d.amenities ? `Amenities: ${d.amenities}` : ""}`;
    }
    function hideTooltip() {
      tooltip.style.display = "none";
    }

    data.map.forEach(u => {
      const rect = document.createElementNS("http://www.w3.org/2000/svg","rect");
      rect.setAttribute("x", u.x);
      rect.setAttribute("y", u.y);
      rect.setAttribute("width", u.w);
      rect.setAttribute("height", u.h);
      rect.setAttribute("id", "unit-"+u.id);
      rect.setAttribute("fill", data.unitData[u.id].status === "Available" ? "green" :
                               data.unitData[u.id].status === "Sold" ? "red" : "orange");
      rect.setAttribute("fill-opacity","0.4");
      rect.setAttribute("stroke","#000");
      rect.setAttribute("stroke-width","1");
      rect.style.cursor="pointer";

      rect.addEventListener("mousemove",(evt)=>showTooltip(evt,{id:u.id, ...data.unitData[u.id]}));
      rect.addEventListener("mouseleave",()=>hideTooltip());

      rect.addEventListener("click",()=>{
        document.querySelectorAll("rect").forEach(r=>r.classList.remove("selected"));
        rect.classList.add("selected");
        document.querySelectorAll(".unit-card").forEach(c=>c.style.background="#2a3646");
        document.getElementById("card-"+u.id).style.background="#3b4a5c";
        document.getElementById("card-"+u.id).scrollIntoView({behavior:"smooth"});

        // Update selected unit panel
        const d = data.unitData[u.id];
        details.style.display = "block";
        details.innerHTML = `<strong>Unit ${u.id}</strong><br>
          Status: ${d.status}<br>
          Dimensions: ${d.length} × ${d.width} (${d.sqft} sqft)<br>
          Price: ${d.price}<br>
          ${d.amenities ? `Amenities: ${d.amenities}` : ""}`;
      });

      svg.appendChild(rect);
    });

    renderSidebar();
  </script>
